(5, 'Seja bem vindo ao meu estúdio !\r\n', 'Bem-vindo ao meu estúdio de tatuagem, um lugar onde a arte\r\n                                    ganha vida e histórias são\r\n                                    contadas na pele. Localizado em um espaço acolhedor e cheio de personalidade, meu\r\n                                    estúdio é um refúgio para aqueles que buscam expressar sua individualidade de\r\n                                    maneira\r\n                                    única.\r\n                                    <br>\r\n                                    <br>\r\n                                    Ao entrar, você será recebido por um ambiente que transmite uma atmosfera misteriosa\r\n                                    e\r\n                                    ao mesmo tempo cativante. As paredes são adornadas com ilustrações que refletem a\r\n                                    essência do dark-work e do old school, criando uma atmosfera imersiva onde a\r\n                                    criatividade flui livremente.\r\n                                    <br>\r\n                                    <br>\r\n                                    Meu estúdio está equipado com as mais modernas e higiênicas instala-rightções,\r\n                                    garantindo um\r\n                                    ambiente seguro para todos os meus clientes. Cada estação de trabalho é\r\n                                    cuidadosamente\r\n                                    organizada, repleta de instrumentos de qualidade e tintas vibrantes, prontos para\r\n                                    dar\r\n                                    vida às mais incríveis criações.\r\n                                    <br><br>\r\n                                    Além disso, a equipe do estúdio é composta por artistas talentosos e apaixonados,\r\n                                    prontos para transformar suas ideias em realidade. Juntos, compartilhamos a visão de\r\n                                    criar tatuagens que transcendem a pele, deixando uma marca profunda e duradoura na\r\n                                    vida\r\n                                    de cada indivíduo.', 'Fazendo história no mundo da tatuagem desde 1980', '   <strong>ACESSIBILIDADE</strong>\r\n            <br>\r\n            Somos pioneiros na adequação dos espaços do estúdio para o portador de mobilidade reduzida. Temos acesso\r\n            adaptado desde a recepção até uma sala exclusiva de atendimento.', ' <strong> BIOSSEGURANÇA </strong>\r\n            <br>\r\n            A Led’s Tattoo é certificada pela Vigilância Sanitária atuando sob rígidas normas de biossegurança e\r\n            assepsia. Possui uma sala exclusiva para a esterilização dos equipamentos.', '   <strong> BIOSSEGURANÇA </strong>\r\n            <br>\r\n            A Led’s Tattoo é certificada pela Vigilância Sanitári', '', '10cm $300 até 500', '25cm $700 até 1000', ' 30cm $1200\r\n                        até 1600', 'Flash $150 até 250', 'Flash $150 até 250', 'Flash $150 até 250');

